import{_ as p,a0 as e,a1 as a,a4 as t}from"./framework-786d5328.js";const c={},r=t('<h1 id="听说快了" tabindex="-1"><a class="header-anchor" href="#听说快了" aria-hidden="true">#</a> 听说快了</h1><p>今天晚上实在没有忍住，去问黄总，时间什么时候可以定下来，本来计划着明天问一下的。</p><p>我这个急性子，真的耐不住性子啊，有什么事情在心里面堆着就是会很难受，搞得整个人都很奇怪的，就是憋不住事呗。不知道要怎么改喂，一点都沉不住气的。也不知道我这种情况，是好还是坏。</p><p>不过这两天的心情是慢慢的往好的方向发展的，对我来说还是挺不错的，有很大的进步，胡思乱想的时间也少了很多。</p><p>那我接下来要做的就是，慢慢的等呗，等到下个礼拜五。</p><p>我也要做到，尝试着把自己躁动不安的心，学会慢慢的，一点一点的沉下心来。</p><p>其实感触挺深的，在我平时看东西的时候，很难入定。一直在抖腿，越抖腿越急躁，我或许可以尝试着先把这个给慢慢的改掉。</p><p>哇！突然想起来，我今天想到的一点。我说，我肯定可以下个礼拜就回去。没想到啊！！！真的可以吗？？</p><p>我的背调肯定能通过！！！我的背调肯定能通过！！！我的背调肯定能通过！！！！！</p><p>这究竟是什么！！！我好像抓住了一点什么东西，通往成功，或者说建立自己信息的方法吗？？？</p><p>这真的管用吗？？？？！！！！！</p><p>这真的管用诶！！这肯定管用！！！</p><p>哇塞！！！这个方法肯定管用！！！！！</p><p>一定要过啊！！！！我的背调肯定能过的！！！！</p><p>说实话挺烦人的，没想到这一步会出现差错。这个社会给我上的第一课就是要诚实，多谢了三个月的工作经历，简直要人命了啊。。。。</p><p>但是不能灰心。肯定能过的！！！我的背调一定能过的！！！今天就能出结果！！！今天就会和我说，你这边的背调通过了哈～～请尽快入职哦～</p><p>肯定能过的！！肯定能过的！！！给我过！！！！背调给我过！！！！</p>',17),_=[r];function n(o,s){return e(),a("div",null,_)}const i=p(c,[["render",n],["__file","8.html.vue"]]);export{i as default};
